import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './components/app/app';
import reportWebVitals from './reportWebVitals';
import {createStore, applyMiddleware} from 'redux';


const booksData = [
  {
    id: 1,
    title: 'Замуж за коня',
    tags: 'властный герой, дерзкая героиня, муж и жена',
    image: 'img/kon.jpg',
    price: 109,
    description: 'Знаете, как быстро выйти замуж? Разозлите отца, будьте откровенны с мачехой, откажите всем приличным женихам в городе и потеряйте волю, когда вам предложат немыслим...'
  },
  {
    id: 2,
    title: 'Хозяин проклятого поместья',
    tags: 'первая любовь, призрак, тайны прошлого',
    image: 'img/hozain.jpg',
    price: 150,
    description: 'Мужчина, скрывающий ото всех своё лицо, или жених, подговоривший на ограбление: кто из них заслуживает моего доверия и любви? *** Ради любимого Элисон готова на всё! ...'
  },
  {
    id: 3,
    title: 'Месть Анны-Луизы',
    tags: ': гендерная интрига, магия и тайны, юмор и любовь',
    image: 'img/mest.jpg',
    price: 150,
    description: 'Моя жизнь пошла крахом после смс: «Свадьбы не будет». Попытка поговорить с женихом открыла причину разрыва — он женится на другой. Можно оставить всё ка...'
  },
];

const store = createStore(reducer, composeWithDevTools());

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
     <Provider store={store}>
    <App 
       booksData={booksData}/>,
       </Provider>
  </React.StrictMode>
);

